  \"2013-03-16T00:45:39.485220\",\n\t\"name\": \"alabama-fault-features\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains fault features compiled
  by the Geological Survey of Alabama, and published as a Web feature service for
  the National Geothermal Data System. Fields in the Fault Feature Content Model will
  become XML elements in interchange documents for WMS simple features provided by
  a node in the USGIN network.  Each observation includes a Fault Name, Symbol, and
  location spatially referenced to EPSG: 4326 (for interoperability).  The data contained
  in the submitted dataset is available as an Access Database (.mdb), Excel Spreadsheet,
  ESRI service, WMS and WFS service.Link to Fault Feature Content Model:  http://stategeothermaldata.org/data_delivery/content_models/fault_feature.\",\n\t\"license_title\":
